/* Import base styles */
@import '/assets/css/base.css';

/* Canvas styles */
canvas#myCanvas {
  position: fixed;
  top: 0;
  left: 0;
  z-index: -1;
  width: 100%;
  height: 100%;
}

/* Navbar styles */
.navbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 20px 50px;
}

/* Logo image styles */
.logo {
  height: 60px;
  width: 60px;
  transition: transform 0.2s;
}

.logo:hover {
  transform: scale(1.2);
}

.cls-1 {
  fill: #D1D1D1;
  stroke-width: 0px;
}

.DWT img {
  width: 70px;
  text-shadow: 0px 4px 25px rgba(0, 0, 0, 0.25);
  transition: transform 0.2s;
}

.DWT img:hover {
  transform: scale(1.2);
}

.designer {
  font-size: 15vw;
  transition: transform 1s ease-in-out;
}

/* Links styles */
.whatnext {
  position: relative;
  display: inline-block;
  cursor: pointer;
  outline: none;
  border: 0;
  vertical-align: middle;
  text-decoration: none;
  background: transparent;
  padding: 0;
  font-family: 'Geist-Black', sans-serif;
  font-size: 16px;
  width: 12rem;
  height: auto;
}

.whatnext .circle {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: relative;
  display: block;
  margin: 0;
  width: 3rem;
  height: 3rem;
  background: linear-gradient(91.29deg, #821BD3 0.23%, #BA20D3 52.52%);
  border-radius: 1.625rem;
}

.whatnext .circle .icon {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: absolute;
  top: 0;
  bottom: 0;
  margin: auto;
  background: var(--vt-c-white);
}

.whatnext .circle .icon.arrow {
  left: 0.625rem;
  width: 1.125rem;
  height: 0.125rem;
  background: none;
}

.whatnext .circle .icon.arrow::before {
  content: '';
  position: absolute;
  top: -0.25rem;
  right: 0.0625rem;
  width: 0.625rem;
  height: 0.625rem;
  border-top: 0.125rem solid var(--vt-c-white);
  border-right: 0.125rem solid var(--vt-c-white);
  transform: rotate(45deg);
}

.whatnext .button-text {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  padding: 0.75rem 0;
  margin: 0 0 0 1.85rem;
  color: var(--vt-c-white);
  font-weight: 700;
  line-height: 1.6;
  text-align: center;
  text-transform: uppercase;
}

.whatnext:hover .circle {
  width: 100%;
}

.whatnext:hover .circle .icon.arrow {
  background: var(--vt-c-white);
  transform: translate(1rem, 0);
}

.whatnext:hover .button-text {
  color: var(--vt-c-white);
}

/* Main content styles */
main {
  display: block;
  scroll-snap-type: y mandatory;
  overflow-y: scroll;
  height: calc(100vh - 100px);
  z-index: 1;
  margin-top: 100px;
}

::-webkit-scrollbar {
  width: 10px;
}

::-webkit-scrollbar-track {
  background-color: none;
}

::-webkit-scrollbar-thumb {
  background: linear-gradient(45deg, #821BD3 0%, #BA20D3 100%);
  border-radius: 10px;
}

/* Section styles */

.section {
  height: calc(100vh - 140px);
  display: flex;
  justify-content: center;
  font-size: 2rem;
  transition: transform 0.5s ease-in-out;
  scroll-snap-align: start;
  z-index: 1;
  flex-wrap: wrap;
  padding-top: 50px;
  opacity: 0;
  transform: scale(0.9) translateY(50px); /* Réduction de la taille et décalage vers le bas */
  transition: opacity 1s ease, transform 0.7s ease;
}

.section.active {
 opacity: 1;
  transform: scale(1) translateY(0); /* Retour à la taille normale et repositionnement */
}

.content1 {
  display: flex;
  flex-direction: column;
  gap: 25px;
  flex: 1;
  max-width: 60%;
  margin-right: 60px;
}

.content2{
  display: flex;
  height: 70%;
  align-items: center;
  margin-left: 60px;
}

#section1 {
  display: flex;
  padding-left: 100px;
  padding-right: 100px;
}

#section4, #section5, #section6 {
  opacity: 1;
}

/* Styles pour la flèche animée */
.scroll-down {
  position: absolute;
  bottom: 40px;
  left: 50%;
  transform: translateX(-50%);
  text-align: center;
  margin-top: 100px;
}

.scroll-down .arrow {
  display: inline-block;
  width: 24px;
  height: 24px;
  border-left: 6px solid var(--vt-c-white);
  border-bottom: 6px solid var(--vt-c-white);
  border-radius: 3px;
  transform: rotate(-45deg);
  animation: scroll-animation 2s infinite;
}

.scroll-down .arrow:hover {
  animation: none; 
  transform: rotate(-45deg) scale(1.2);
}

@keyframes scroll-animation {
  0% {
    transform: rotate(-45deg) translate(0, 0);
  }
  50% {
    transform: rotate(-45deg) translate(-10px, 10px);
  }
  100% {
    transform: rotate(-45deg) translate(0, 0);
  }
}

.rectangle-container-main {
  display: flex;
}

.rectangle-container {
  display: flex;
  flex-direction: column;
}

.rectangle {
  display: flex;
  flex-direction: column;
  justify-content: center;
  position: relative;
  border-radius: 30px;
  box-shadow: 0px 4px 25px 5px rgba(0, 0, 0, 0.25);
  background-color: var(--vt-c-grey);
  margin: 30px;
  padding: 0 50px;
  cursor: pointer;
  transition: all 0.3s ease;
  width: 350px;
  height: 250px;
  transition: transform 0.3s;
}

.rectangle h5 {
  margin-bottom: 10px;
  background: linear-gradient(91.29deg, #BA20D3 0.23%, #821BD3 52.52%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
}

.rectangle img {
  display: block;
  opacity: 0;
  transition: opacity 0.3s ease;
  width: 100%;
  height: 100%;
  object-fit: cover;
  position: absolute;
  top: 0;
  left: 0;
  border-radius: 30px;
  z-index: 0;
}

.rectangle:hover {
  transform: scale(1.1);
  z-index: 2;
}

.rectangle:hover img {
  opacity: 1;
}

.rectangle::before {
  content: "";
  position: absolute;
  top: -5px;
  left: -5px;
  right: -5px;
  bottom: -5px;
  border-radius: 35px;
  background: linear-gradient(45deg, #821BD3, #BA20D3);
  z-index: -1;
  opacity: 0;
  transition: opacity 0.3s ease;
}

.rectangle:hover::before {
  opacity: 1;
}

h5.summary {
  font-size: 24px;
}

.badge {
  position: absolute;
  top: -20px;
  left: -20px;
  width: 40px;
  height: 40px;
  background-color: var(--vt-c-grey);
  border: solid 2px var(--vt-c-rose);
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 16px;
}

.button-container {
  gap: 40px;
}

.highlight {
  background: linear-gradient(91.29deg, #BA20D3 0.23%, #821BD3 52.52%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
}

/* Button styles */

.button {
  font-size: 16px;
  font-family: 'Geist-Bold', sans-serif;
  padding: 15px 25px;
  background-color: transparent;
  border: none;
  border-radius: 30px;
  position: relative;
  overflow: hidden;
  cursor: pointer;
  transition: transform 0.3s;
  margin-right: 5px;
}

.button img {
  width: 20px;
}

.button:hover {
  transform: scale(1.1);
}

.button:hover .wave {
  top: -120px;
}

.button span {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
  position: relative;
  z-index: 1;
  color: var(--vt-c-white);
  font-size: 16px;
}

.button .wave {
  width: 220px;
  height: 220px;
  background: linear-gradient(90deg, #821BD3 0.23%, #BA20D3 52.52%);
  box-shadow: 0px 4px 25px 5px rgba(0, 0, 0, 0.25);
  position: absolute;
  left: 0;
  top: 60px;
  transition: 0.6s;
}

.button .wave::before,
.button .wave::after {
  width: 175%;
  height: 175%;
  content: '';
  position: absolute;
  top: 0;
  left: 50%;
  transform: translate(-50%, -75%);
}

.button .wave::before {
  border-radius: 45%;
  background-color: var(--vt-c-grey);
}

.button .wave::after {
  border-radius: 40%;
  background-color: var(--vt-c-grey);
}

@keyframes wave {
  0% {
    transform: translate(-50%, -75%) rotate(0deg);
  }
  100% {
    transform: translate(-50%, -75%) rotate(360deg);
  }
}

/* Footer styles */
footer {
  position: fixed;
  height: 90px;
  bottom: 0;
  text-align: center;
}

/* Mac window styles */

.mac-window {
  width: 65%;
  height: 75%;
  background: rgba(0, 0, 0, 0.4);
  border-radius: 30px;
  overflow: hidden;
}

.mac-header {
  display: flex;
  justify-content: flex-end;
  padding: 10px;
  background: rgba(255, 255, 255, 0.5);
  border-radius: 30px 30px 0 0;
}

.mac-dot {
  height: 15px;
  width: 15px;
  border-radius: 50%;
  margin-right: 10px;
}

.mac-content {
  padding: 40px;
}

.mac-menu {
  display: flex;
  align-items: center;
  justify-content: space-between;
  z-index: 2;
}

.menu-item {
  font-size: 24px;
  margin: 0 10px;
  cursor: pointer;
  padding: 5px 5px;
  border-radius: 30px;
}

.menu-item:hover, .menu-item.active {
  background: linear-gradient(90deg, #821BD3 0.23%, #BA20D3 52.52%);
}

.line {
  height: 1px;
  background-color: #ccc;
  margin: 10px 0;
}

.content {
  display: flex;
  transition: transform 0.3s ease-in-out;
}

.content-item {
  min-width: 100%;
  display: none;
}

.content-item.active {
  display: block;
}

.red {
  background: rgba(255, 0, 0, 0.5);
}

.red:hover {
  background: red;
}

.yellow {
  background: rgba(255, 92, 0, 0.5);
}

.yellow:hover {
  background: orange;
}

.green {
  background: rgba(82, 255, 0, 0.5);
}

.green:hover {
  background: greenyellow;
}

.mac-content {
  padding: 40px;
}

.mac-menu {
