  flex-direction: column; 
  align-items: center;
  padding: 10px;
  border-radius: 10px;
}

.skill-icon {
  width: 50px; /* Ajustez la taille selon vos besoins */
  height: 50px;
  fill: var(--vt-c-white);
  margin-bottom: 10px; /* Espace entre l'icône et le texte */
}

.rating {
  color: #9c27b0; /* Couleur violette pour les étoiles */
}

.star {
  font-size: 25px; /* Ajustez la taille des étoiles */
}

.starwhite {
  font-size: 25px;
  color: #D1D1D1;
}

@keyframes scaleUpDown {
  0%, 100% {
    transform: scaleY(1) scaleX(1);
  }
  50%, 90% {
    transform: scaleY(1.1);
  }
  75% {
    transform: scaleY(0.95);
  }
  80% {
    transform: scaleX(0.95);
  }
}

@keyframes shake {
  0%, 100% {
    transform: skewX(0) scale(1);
  }
  50% {
    transform: skewX(5deg) scale(0.9);
  }
}

@keyframes particleUp {
  0% {
    opacity: 0;
  }
  20% {
    opacity: 1;
  }
  80% {
    opacity: 1;
  }
  100% {
    opacity: 0;
    top: -100%;
    transform: scale(0.5);
  }
}

@keyframes glow {
  0%, 100% {
    background-color: #821BD3;
  }
  50% {
    background-color: #BA20D3;
  }
}

.fire {
  position: relative;
  top: 0;
  left: 0;
  width: 200px;
  height: 200px;
  background-color: transparent;
  margin-left: auto;
  margin-right: auto;
  margin-top: 40px;
}

.fire-center {
  position: absolute;
  height: 100%;
  width: 100%;
  animation: scaleUpDown 3s ease-out infinite;
  animation-fill-mode: both;
}

.fire-center .main-fire {
  position: absolute;
  width: 100%;
  height: 100%;
  background-image: radial-gradient(
    farthest-corner at 10px 0,
    #821BD3 0%,
    #BA20D3 95%
  );
  transform: scaleX(0.8) rotate(45deg);
  border-radius: 0 40% 60% 40%;
}

.fire-center .particle-fire {
  position: absolute;
  top: 60%;
  left: 45%;
  width: 10px;
  height: 10px;
  background-color: #BA20D3;
  border-radius: 50%;
  animation: particleUp 2s ease-out infinite;
  animation-fill-mode: both;
}

.fire-right {
  height: 100%;
  width: 100%;
  position: absolute;
  animation: shake 2s ease-out infinite;
  animation-fill-mode: both;
}

.fire-right .main-fire {
  position: absolute;
  top: 15%;
  right: -25%;
  width: 80%;
  height: 80%;
  background-color: #BA20D3;
  transform: scaleX(0.8) rotate(45deg);
  border-radius: 0 40% 60% 40%;
}

.fire-right .particle-fire {
  position: absolute;
  top: 45%;
  left: 50%;
  width: 15px;
  height: 15px;
  background-color: #BA20D3;
  transform: scaleX(0.8) rotate(45deg);
  border-radius: 50%;
  animation: particleUp 2s ease-out infinite;
  animation-fill-mode: both;
}

.fire-left {
  position: absolute;
  height: 100%;
  width: 100%;
  animation: shake 3s ease-out infinite;
  animation-fill-mode: both;
}

.fire-left .main-fire {
  position: absolute;
  top: 15%;
  left: -20%;
  width: 80%;
  height: 80%;
  background-color: #BA20D3;
  transform: scaleX(0.8) rotate(45deg);
  border-radius: 0 40% 60% 40%;
}

.fire-left .particle-fire {
  position: absolute;
  top: 10%;
  left: 20%;
  width: 10%;
  height: 10%;
  background-color: #BA20D3;
  border-radius: 50%;
  animation: particleUp 3s infinite ease-out;
  animation-fill-mode: both;
}

/* Waves Effect */

.block {
  width: 100%;
  height: 175px;
  background-color: transparent;
}

.waves-container {
  position: fixed;
  width: 100%;
  height: 175px;
  overflow: hidden;
  z-index: -1;
}

.waves {
  position: fixed;
  height: 175px;
}

.wave {
  position: fixed;
  bottom: 0;
  left: 0;
  background: url(/assets/img/wave.png);
  width: 100%;
  height: 175px;
  background-size: 1500px 200px;
}

.following {
  width: 100%;
  height: 175px;
  background-color: #BA20D3;
}

#wave1 {
  bottom: 0;
  opacity: 1;
  z-index: 5;
  animation: wave_moving 10.5s infinite linear;
}

#wave2 {
  bottom: 10px;
  opacity: 0.5;
  z-index: 4;
  animation: wave_moving_reverse 6s infinite linear;
}

#wave3 {
  bottom: 15px;
  opacity: 0.7;
  z-index: 3;
  animation: wave_moving 6.5s infinite linear;
}

#wave4 {
  bottom: 20px;
  opacity: 0.4;
  z-index: 2;
  animation: wave_moving_reverse 4.5s infinite linear;
}

#wave5 {
  bottom: 0;
  opacity: 0.5;
  z-index: 1;
  animation: wave_moving 8s infinite linear;
}

@keyframes wave_moving {
  0% {
    background-position-x: 1500px;
    transform: translateY(75px);
  }
  50% {
    transform: translateY(75px);
  }
  100% {
    background-position-x: 0px;
    transform: translateY(75px);
  }
}

@keyframes wave_moving_reverse {
  0% {
    background-position-x: 0px;
    transform: translateY(75px);
  }
  50% {
    transform: translateY(0px);
  }
  100% {
    background-position-x: 1500px;
    transform: translateY(75px);
  }
}

.path {
  stroke: black;
  stroke-width: 2;
  fill: none;
  stroke-dasharray: 1500;
  stroke-dashoffset: 1500;
  animation: draw 4s forwards;
}

.fill {
  fill: url(#paint0_linear_186_3);
  animation: fill 2s forwards;
  animation-delay: 4s;
}

@keyframes draw {
  to {
    stroke-dashoffset: 0;
  }
}

@keyframes fill {
  from {
    fill-opacity: 0;
  }
  to {
    fill-opacity: 1;
  }
}

