      max-width: 100%;
      margin-right: 0;
      gap: 0;
    }
    
    .content2{
      margin-left: 0;
    }

    .designer {
      transform: rotate(90deg); /* Rotation à 90 degrés */
    }

    #section2,#section3 {
      padding-top: 10px;
