    font-size: 55px;
  }

  .button {
    padding: 12px 16px;
    border-radius: 20px;
    margin-bottom: 10px;
  }

  .rectangle {
    width: 250px;
    height: 200px;
  }

  .rectangle p {
    font-size: 16px;
